#CREATE SCHEMA `cloud`;

DROP TABLE IF EXISTS `Reply`;

DROP TABLE IF EXISTS `Favorite`;

DROP TABLE IF EXISTS `Post`;

DROP TABLE IF EXISTS `Following`;

DROP TABLE IF EXISTS `Scroll`;

DROP TABLE IF EXISTS `Session`;

DROP TABLE IF EXISTS `User`;

CREATE TABLE `User` (

	-- `UserID` INT NOT NULL AUTO_INCREMENT,
	-- `Username` VARCHAR (16) ,#NOT NULL,
	-- `Name` VARCHAR (16) ,#NOT NULL,
	-- `Lastname` VARCHAR (16) ,#NOT NULL,
	-- `Email` VARCHAR (32) ,#NOT NULL,
	-- `Password` VARCHAR(64) ,#NOT NULL,
	-- `About` VARCHAR (256),

	-- `id` mediumint(8) unsigned NOT NULL auto_increment,
	-- `UserID` mediumint,
	`UserID` INT NOT NULL AUTO_INCREMENT,
	-- `Username` TEXT default NULL,
	`Username` VARCHAR (512) ,#NOT NULL
	`Name` varchar(255) default NULL,
	`Lastname` varchar(255) default NULL,
	`Email` varchar(255) default NULL,
	`Password` varchar(255),
	`About` TEXT default NULL,

PRIMARY KEY (`UserID`),
	UNIQUE KEY `UserName` (`UserName`),
	UNIQUE KEY `Email` (`Email`)#,

#INDEX `Get_Username` (`UserID`, `Username`)
);

CREATE TABLE `Session` (
	`SessionID` INT NOT NULL AUTO_INCREMENT,
	`UserID` INT NOT NULL,
	`Token` VARCHAR(28) NOT NULL,

PRIMARY KEY (`SessionID`),
	UNIQUE KEY `Token` (`Token`),

CONSTRAINT `fk_UserID_Session`
	FOREIGN KEY (`UserID`)
	REFERENCES `User` (`UserID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

INDEX `Index_UserID` (`UserID`)
);

CREATE TABLE `Scroll` (
	`ScrollID` INT NOT NULL AUTO_INCREMENT,
	`SessionID` INT NOT NULL,
	`Token` VARCHAR(28) NOT NULL,
	`Datetime` TIMESTAMP NOT NULL,

PRIMARY KEY (`ScrollID`),
	UNIQUE KEY `Token` (`Token`),

CONSTRAINT `fk_SessionID_Scroll`
	FOREIGN KEY (`SessionID`)
	REFERENCES `Session` (`SessionID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

INDEX `Index_SessionID` (`SessionID`),
INDEX `Index_SessionID_Token` (`SessionID`,`Token`)
);

#Scrollable
	#ScrollID
	#SessionID
	#ScrollToken
	#Start Time
	#Last Time


CREATE TABLE `Post` (
	`PostID` INT NOT NULL AUTO_INCREMENT,
	`UserID` INT NOT NULL,

	-- `PostMessage` VARCHAR (256),
	-- `PostLink` VARCHAR (256),

	`PostMessage` VARCHAR (512),
	`PostLink` VARCHAR (512),

	`Datetime` TIMESTAMP NOT NULL,
	`FavoriteCount` INT NOT NULL DEFAULT 0,
	`ReplyCount` INT NOT NULL DEFAULT 0,
	#Index (UserID, Datetime, PostID)

PRIMARY KEY (`PostID`),

CONSTRAINT `fk_UserID_Post`
	FOREIGN KEY (`UserID`)
	REFERENCES `User` (`UserID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

INDEX `Index_UserID` (`UserID`),
#INDEX `Get_Posts_by_UserID` (`UserID`, `PostID`),
#INDEX `Get_Posts_by_UserID_and_Datetime` (`UserID`, `Datetime`, `PostID`)
INDEX `Index_UserID_Datetime` (`UserID`, `Datetime`)
);
	
CREATE TABLE `Reply` (
	`ReplyID` INT NOT NULL AUTO_INCREMENT,
	`PostID` INT NOT NULL,
	`UserID` INT NOT NULL,

	`ReplyMessage` VARCHAR (1024),
	`Datetime` TIMESTAMP NOT NULL,

	`VoteCount` INT NOT NULL DEFAULT 0,
	`Votes` BLOB,

	`Lock` BOOLEAN NOT NULL DEFAULT FALSE,

#	Votes (Blob -> Java HashMap)
#		UserID (int)
#		Direction (int)
#		Datetime (String)
#
#	Index (PostID, ReplyID, Datetime, VoteCount)

PRIMARY KEY (`ReplyID`),

CONSTRAINT `fk_PostID_Reply`
	FOREIGN KEY (`PostID`)
	REFERENCES `Post` (`PostID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

CONSTRAINT `fk_UserID_Reply`
	FOREIGN KEY (`UserID`)
	REFERENCES `User` (`UserID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

INDEX `Index_PostID` (`PostID`),
INDEX `Index_PostID_Datetime` (`PostID`, `Datetime`),
-- INDEX `Index_PostID_VoteCount` (`PostID`, `VoteCount`)
);

CREATE TABLE Following (
	`FollowingID` INT NOT NULL AUTO_INCREMENT,
	`UserID` INT NOT NULL,
	`FollowingUserID` INT NOT NULL,

PRIMARY KEY (`FollowingID`),

CONSTRAINT `fk_UserID_Following`
	FOREIGN KEY (`UserID`)
	REFERENCES `User` (`UserID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

CONSTRAINT `fk_FollowingUserID_Following`
	FOREIGN KEY (`FollowingUserID`)
	REFERENCES `User` (`UserID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

INDEX `Index_UserID` (`UserID`),
INDEX `Index_FollowingUserID` (`FollowingUserID`)
);

CREATE TABLE Favorite (
	`UserID` INT NOT NULL,
	`PostID` INT NOT NULL,

PRIMARY KEY (`UserID`),

CONSTRAINT `fk_UserID_Favorite`
	FOREIGN KEY (`UserID`)
	REFERENCES `User` (`UserID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

CONSTRAINT `fk_PostID_Favorite`
	FOREIGN KEY (`PostID`)
	REFERENCES `Post` (`PostID`)
	ON DELETE CASCADE
	ON UPDATE CASCADE,

INDEX `Index_PostID` (`PostID`)
);

